export default function ImagesPage() {
  const images = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSPb4MglUQmRo7FPHHHnilGx3AsSjYuCn3IgQ&s",
  ];
  return (
    <div className="p-8 grid gap-4 w-fit mx-auto grid-cols-1 md:grid-cols-2 lg:grid-cols-3">
      {images.map((src, idx) => (
        <img
          key={idx}
          src={src}
          className="size-96 object-cover rounded-xl border transition-all duration-300 brightness-50 hover:scale-105 hover:brightness-100"
        />
      ))}
    </div>
  );
}
